    public  static int[] twoSum(int[] nums, int target) {
        int[] result = new int[2];
        if (nums.length<1)
            return result;
        boolean flag = false;
        for (int i = 0;i <  nums.length-1; i++) {
            int a = nums[i];
            for (int j = i + 1; j < nums.length; j ++){
                int b = nums[j];
                if ( (a+b)== target ){
                    result[0] = i;
                    result[1] = j;
                    flag = true;
                }
            }
            if (flag)
                break;
        }
        return result;
    }

    public static int lengthOfLongestSubstring(String s) {
        if (s == null || "".equals(s)){
            return 0;
        }
        int lengthOri = s.length();
        char[] c = s.toCharArray();
        List<Character> stringList = new ArrayList<>();
        for (char a : c){
            stringList.add(new Character(a));
        }
        Set<Character> stringSet = new HashSet<>(stringList);
        if (lengthOri == stringSet.size())
            return lengthOri;
        else {
            boolean flag = false;
            for (int k = stringList.size()-1; k > 0; k -- ) {
                for (int i = 0; i <= stringList.size()-k; i ++) {
                    int j = k + i;
                    if (j > stringList.size() )
                        break;
                    flag = compareListAndSet(i , j, stringList);

                    if (flag){
                        System.out.println(i);
                        System.out.println(j);
                        return k;
                    }
                }

            }
            return 1;
        }
    }

    private static boolean compareListAndSet(int i , int j, List<Character> stringList) {
        List<Character> subList = stringList.subList(i, j);
        Set<Character> stringSet1 = new HashSet<>(subList);
        if (subList.size() == stringSet1.size()){
            return true;
        }
        return false;
    }
